/// @title FeeCollector
/// @author Daniel Wang - <daniel@loopring.org>
contract FeeCollector is Drainable, OwnerManagable
{
    function canDrain(address drainer, address /*token*/)
        public
        override
        view
        returns (bool)
    {
        return isManager(drainer) || drainer == owner;
    }

    // Allow receiving ETH
    receive() payable external {}
}
